import React, { Component } from 'react';

class Product extends Component {
    render() {

        var {id, name, img, price} = this.props;

        return (
        	<div>
        		<h1>
                	Day la trang chi tiet san pham {name}
            	</h1>
            	<div>
            		<div>
            			<img src={img} alt=""/>
            		</div>
            	</div>
        	</div>
         
        );
    }
}

export default Product;
